import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title:string = 'northwind';
  user:string = 'Burak Temelkaya';
  product:any={productId:1}
}

//component htmlin datasını yönettiğimiz yerdir
<h1>Welcome to <b>{{title}}</b><br></h1>
Hello {{user}}

<ul>
  <li>Laptop</li>
  <li>Mouse</li>
  <li>Keyboard</li>
  <li>Table</li>
</ul>
